import './popup.scss';
import { Link } from 'react-router-dom';


const Popup = (props) => {
  return (props.trigger) ? (
    <div className="pop-up">
      <div className="pop-up_inner">
        <h1>Вітаємо у магазині <br />Humane and Healthy</h1>
        <div>
          <Link to="/">перейти до магазину</Link>
          </div>
      </div>
    </div>
  ) : ""
} 

export default Popup;
